// Importuj Vue i VueRouter
import Vue from "vue";
import VueRouter from "vue-router";

// Importuj komponenty
import PLKComponent from "../views/Plk.vue";

// Użyj VueRouter
Vue.use(VueRouter);

// Zdefiniuj trasę
const routes = [
  {
    path: "/plk",
    name: "PLK",
    component: PLKComponent,
  },
];

// Utwórz nową instancję routera
const router = new VueRouter({
  routes,
  mode: "history", // Ustaw tryb historii routingu (opcjonalnie)
});

// Eksportuj router
export default router;
